INSERT INTO `classrooms` (`id`, `teacher_id`, `class`, `subject`, `description`, `date_time_created`, `is_review_open`, `date_end`, `is_deleted`) VALUES
(1, 7, 'BSCS - 4A', 'ADVANCE PHP', 'Our Advanced PHP Development course gives you the concepts, features, tools, and practical advice to use them together to build performant, secure, scalable, and reliable web applications. This class enables developers to tackle the most advanced features of PHP.', '2021-02-07 18:33:15', 1, '2022-03-26', 0),
(2, 7, 'BSCS - 4B', 'ADVANCE PHP', 'Our Advanced PHP Development course gives you the concepts, features, tools, and practical advice to use them together to build performant, secure, scalable, and reliable web applications. This class enables developers to tackle the most advanced features of PHP.', '2021-02-07 18:42:32', 1, '2022-03-26', 0),
(3, 7, 'BSCS - 4C', 'ADVANCE PHP', 'Our Advanced PHP Development course gives you the concepts, features, tools, and practical advice to use them together to build performant, secure, scalable, and reliable web applications. This class enables developers to tackle the most advanced features of PHP.', '2021-02-07 18:43:01', 1, '2022-03-26', 0),
(4, 7, 'BSIT - 4A', 'ADVANCE PHP', 'Our Advanced PHP Development course gives you the concepts, features, tools, and practical advice to use them together to build performant, secure, scalable, and reliable web applications. This class enables developers to tackle the most advanced features of PHP.', '2021-02-07 18:43:23', 1, '2022-03-26', 0),
(5, 8, 'BSCS - 4A', 'COMPUTER NETWORKING', 'This course provides an introduction to computer networks, with a special focus on the Internet architecture and protocols. Topics include layered network architectures, addressing, naming, forwarding, routing, communication reliability, the client-server model, web and email protocols.', '2021-02-07 18:46:21', 1, '2022-03-26', 0),
(6, 8, 'BSCS - 4B', 'COMPUTER NETWORKING', 'This course provides an introduction to computer networks, with a special focus on the Internet architecture and protocols. Topics include layered network architectures, addressing, naming, forwarding, routing, communication reliability, the client-server model, web and email protocols.', '2021-02-07 18:46:57', 1, '2022-03-26', 0),
(7, 8, 'BSCS - 4C', 'COMPUTER NETWORKING', 'This course provides an introduction to computer networks, with a special focus on the Internet architecture and protocols. Topics include layered network architectures, addressing, naming, forwarding, routing, communication reliability, the client-server model, web and email protocols.', '2021-02-07 18:48:33', 1, '2022-03-26', 0),
(8, 8, 'BSIT - 4A', 'COMPUTER NETWORKING', 'This course provides an introduction to computer networks, with a special focus on the Internet architecture and protocols. Topics include layered network architectures, addressing, naming, forwarding, routing, communication reliability, the client-server model, web and email protocols.', '2021-02-07 18:48:54', 1, '2022-03-26', 0),
(9, 16, 'BSCS - 4A', 'ADVANCED JAVA', 'Advanced Java is everything that goes beyond Core Java – most importantly the APIs defined in Java Enterprise Edition, includes Servlet programming, Web Services, the Persistence API, etc. It is a Web & Enterprise application development platform which basically follows client & server architecture', '2021-02-07 18:51:08', 1, '2022-03-26', 0),
(10, 16, 'BSCS - 4B', 'ADVANCED JAVA', 'Advanced Java is everything that goes beyond Core Java – most importantly the APIs defined in Java Enterprise Edition, includes Servlet programming, Web Services, the Persistence API, etc. It is a Web & Enterprise application development platform which basically follows client & server architecture', '2021-02-07 18:51:44', 1, '2022-03-26', 0),
(11, 39, 'BSCS - 4A', 'THESIS A', 'The thesis is one of the most important concepts in college expository writing. A thesis sentence focuses your ideas for the paper; it\'s your argument or insight or viewpoint crystallized into a sentence or two that gives the reader your main idea.', '2021-02-07 18:53:19', 1, '2022-03-26', 0),
(12, 39, 'BSCS - 4B', 'THESIS A', 'The thesis is one of the most important concepts in college expository writing. A thesis sentence focuses your ideas for the paper; it\'s your argument or insight or viewpoint crystallized into a sentence or two that gives the reader your main idea.', '2021-02-07 18:53:38', 1, '2022-03-26', 0);
