(1, 1, 'pictures/news/news-1.jpg', 'Biden hosts first of chats to talk ‘directly’ with Americans', 'WASHINGTON – US President Joe Biden on Saturday launched a series of conversations with ordinary Americans by calling a woman who lost her job due to the pandemic, in an effort to showcase his direct contact with his fellow citizens.\r\n\r\n“The White House will launch a new effort for the president to regularly communicate directly with the American people,” White House spokeswoman Jen Psaki said Friday.\r\n\r\nDue to Covid-19, the conversation was held via telephone from the Oval Office in Washington to Michele, a mother from Roseville, California who lost her job at a start-up company because of the economic crisis sparked by the pandemic.\r\n\r\nShe had written to Biden to tell him about her struggles and her search for a new job.\r\n\r\n“Like my dad used to say, a job is about a lot more than a paycheck. It’s about your dignity, it’s about your respect, it’s about your place in the community,” the 78-year-old president told Michele, in a video of the call posted online by the White House.\r\n\r\nBiden also took the opportunity to promote his $1.9 trillion stimulus package that his Democratic party is preparing to adopt in Congress, despite the lack of Republican support, as well as the massive vaccination campaign he has promised.\r\n\r\n“We’re so glad that we have you focusing on that,” said Michele, whose last name was withheld, adding that her parents had just made their appointment to get their Covid-19 vaccinations.\r\n\r\nWith this new conversation series, Biden is seeking to show his empathy — and to mark a break from his predecessor Donald Trump, who was accused by critics of not caring about the fate of millions of Americans affected by America’s health and economic crises.\r\n\r\nBiden’s phone calls are meant to be a modern-day iteration, in the era of social media, of the radio fireside chats held by President Franklin Delano Roosevelt in the 1930s as a way to invite himself into American homes.\r\n\r\nTrump only sporadically took up this tradition, in the form of pre-recorded videos published on Facebook.', '2021-02-07 19:07:03', 1),
(2, 1, 'pictures/news/news-2.jpg', 'Tens of thousands protest Myanmar coup despite internet ban', 'Tens of thousands of people took to the streets of Myanmar’s cities on Saturday to denounce this week’s coup and demand the release of elected leader Aung San Suu Kyi despite a blockade on the internet by the junta.\r\n\r\nIn an upwelling of anger in the country’s largest city, Yangon, protesters chanted, “Military dictator, fail, fail; Democracy, win, win” and held banners reading “Against military dictatorship”. Bystanders offered them food and water.\r\n\r\nLate in the evening, a rumour of Suu Kyi’s release – quickly denied by her lawyer – triggered noisy street celebrations.\r\n\r\nCheering and letting off firecrackers, residents said the message was shared by the military-run media Myawaddy. But Suu Kyi’s lawyer Khin Maung Zaw denied that the 75-year-old leader had been freed and told Reuters she was still in detention.\r\n\r\nSuu Kyi’s National League for Democracy (NLD) won Nov. 8 elections in a landslide, a result the generals have refused to recognise, claiming fraud.\r\n\r\nEarlier, thousands marched on Yangon’s City Hall. Drivers honked horns and leaned out of their cars and raised the three-finger salute, a gesture returned by protesters. Some of them held up NLD flags or pictures of Suu Kyi and clapped and danced.\r\n\r\n\r\nBy evening, the protesters had mostly dispersed. But for a fifth night, a cacophony rose in the darkness as people banged on pots, pans and drums in a show of resistance even as power cuts affected many districts of the city.\r\n\r\nThousands more took to the streets in Myanmar’s second city Mandalay and its military-built capital Naypyidaw, home to the nation’s government servants, where demonstrators chanted anti-coup slogans and called for Suu Kyi’s release.\r\n\r\nThe protests built despite a blockade of the internet imposed after demonstrators first began to gather. All-day, the state-run broadcaster MRTV showed scenes praising the military.\r\n\r\nMonitoring group NetBlocks Internet Observatory reported a “national-scale internet blackout”, saying on Twitter that connectivity had fallen to 16% of usual levels.\r\n\r\nThe junta did not respond to requests for comment. It extended a social media crackdown to Twitter and Instagram after seeking to silence dissent by blocking Facebook, which counts half of the population as users.\r\n\r\nFacebook urged the junta to unblock social media.\r\n\r\n“At this critical time, the people of Myanmar need access to important information and to be able to communicate with their loved ones,” Facebook’s head of public policy for Asia-Pacific emerging countries, Rafael Frankel, said in a statement.\r\n\r\nThe United Nations human rights office said on Twitter that “internet and communication services must be fully restored to ensure freedom of expression and access to information.”\r\n\r\nNorwegian mobile network provider Telenor ASA said authorities had ordered all mobile operators to temporarily shut down the data network, although voice and SMS services remained open.\r\n\r\nMyanmar civil society groups appealed to internet providers to resist the junta’s orders, saying in a joint statement they were “essentially legitimising the military’s authority”.\r\n\r\nTelenor said it regretted the impact of the shutdown on the people of Myanmar but said it was bound by local law and its first priority was the safety of its local workers.\r\n\r\nINTERNATIONAL FALLOUT\r\n\r\nArmy chief Min Aung Hlaing seized power alleging fraud, although the electoral commission says it has found no evidence of widespread irregularities in the November vote.\r\n\r\nThe junta announced a one-year state of emergency and has promised to hand over power after new elections, without giving a timeframe.\r\n\r\nNobel Peace laureate Suu Kyi, has been charged with illegally importing six walkie-talkies, while ousted President Win Myint is accused of flouting COVID-19 restrictions. Neither has been seen since the coup. Their lawyer said they were being held in their homes.\r\n\r\n\r\n\r\nWORLD\r\n\r\nTens of thousands protest Myanmar coup despite internet ban\r\nReuters / 06:24 AM February 07, 2021\r\nmyanmar\r\nDemonstrators protest against the military coup and demand the release of elected leader Aung San Suu Kyi, in Yangon, Myanmar, February 6, 2021. REUTERS/Stringer\r\n\r\nTens of thousands of people took to the streets of Myanmar’s cities on Saturday to denounce this week’s coup and demand the release of elected leader Aung San Suu Kyi despite a blockade on the internet by the junta.\r\n\r\nIn an upwelling of anger in the country’s largest city, Yangon, protesters chanted, “Military dictator, fail, fail; Democracy, win, win” and held banners reading “Against military dictatorship”. Bystanders offered them food and water.\r\n\r\nADVERTISEMENT\r\n\r\nLate in the evening, a rumour of Suu Kyi’s release – quickly denied by her lawyer – triggered noisy street celebrations.\r\n\r\nCheering and letting off firecrackers, residents said the message was shared by the military-run media Myawaddy. But Suu Kyi’s lawyer Khin Maung Zaw denied that the 75-year-old leader had been freed and told Reuters she was still in detention.\r\n\r\nSuu Kyi’s National League for Democracy (NLD) won Nov. 8 elections in a landslide, a result the generals have refused to recognise, claiming fraud.\r\n\r\nEarlier, thousands marched on Yangon’s City Hall. Drivers honked horns and leaned out of their cars and raised the three-finger salute, a gesture returned by protesters. Some of them held up NLD flags or pictures of Suu Kyi and clapped and danced.\r\n\r\n\r\nBy evening, the protesters had mostly dispersed. But for a fifth night, a cacophony rose in the darkness as people banged on pots, pans and drums in a show of resistance even as power cuts affected many districts of the city.\r\n\r\nThousands more took to the streets in Myanmar’s second city Mandalay and its military-built capital Naypyidaw, home to the nation’s government servants, where demonstrators chanted anti-coup slogans and called for Suu Kyi’s release.\r\n\r\nThe protests built despite a blockade of the internet imposed after demonstrators first began to gather. All day, the state-run broadcaster MRTV showed scenes praising the military.\r\n\r\nMonitoring group NetBlocks Internet Observatory reported a “national-scale internet blackout”, saying on Twitter that connectivity had fallen to 16% of usual levels.\r\n\r\nThe junta did not respond to requests for comment. It extended a social media crackdown to Twitter and Instagram after seeking to silence dissent by blocking Facebook, which counts half of the population as users.\r\n\r\nADVERTISEMENT\r\n\r\nFacebook urged the junta to unblock social media.\r\n\r\n“At this critical time, the people of Myanmar need access to important information and to be able to communicate with their loved ones,” Facebook’s head of public policy for Asia-Pacific emerging countries, Rafael Frankel, said in a statement.\r\n\r\nThe United Nations human rights office said on Twitter that “internet and communication services must be fully restored to ensure freedom of expression and access to information.”\r\n\r\nNorwegian mobile network provider Telenor ASA said authorities had ordered all mobile operators to temporarily shut down the data network, although voice and SMS services remained open.\r\n\r\nMyanmar civil society groups appealed to internet providers to resist the junta’s orders, saying in a joint statement they were “essentially legitimising the military’s authority”.\r\n\r\nTelenor said it regretted the impact of the shutdown on the people of Myanmar but said it was bound by local law and its first priority was the safety of its local workers.\r\n\r\nINTERNATIONAL FALLOUT\r\n\r\nArmy chief Min Aung Hlaing seized power alleging fraud, although the electoral commission says it has found no evidence of widespread irregularities in the November vote.\r\n\r\nThe junta announced a one-year state of emergency and has promised to hand over power after new elections, without giving a timeframe.\r\n\r\nNobel Peace laureate Suu Kyi, has been charged with illegally importing six walkie-talkies, while ousted President Win Myint is accused of flouting COVID-19 restrictions. Neither has been seen since the coup. Their lawyer said they were being held in their homes.  \r\n\r\n \r\n\r\nNLD member Aung Moe Nyo, chief minister of the Magway region, said on Facebook before the shutdown: “It is not OK to let the country fall under junta government. I am very much thankful to those who oppose this, to those government staff who oppose this. This act is to save the country.”\r\n\r\nSean Turnell, an Australian economic adviser to Suu Kyi, said in a message to Reuters on Saturday he was being detained.\r\n\r\nAustralia’s government, without naming Turnell, said it had summoned the Myanmar ambassador to register “deep concern” over the arbitrary detention of Australian and other foreign nationals in Myanmar.\r\n\r\nA civil disobedience movement has been building in Myanmar all week, with doctors and teachers among those refusing to work. Every night people bang pots and pans in a show of anger.\r\n\r\nThe protests in Yangon would resume on Sunday, demonstrators said. One, who asked not to be named, said: “We will go and protest again tomorrow. If they arrest one person, we will try to pile in and fill up the [police] truck as a group.”\r\n\r\nThe coup has sparked international outrage, with the United States considering sanctions against the generals and the U.N. Security Council calling for the release of all detainees.\r\n\r\nIt has also deepened tensions between the United States and China, which has close links to Myanmar’s military. Secretary of State Antony Blinken pressed top Chinese diplomat Yang Jiechi in a phone call on Friday to condemn the coup, the State Department said.\r\n\r\nThe generals have few overseas interests vulnerable to sanctions but the military’s extensive business investments could suffer if foreign partners leave – as Japanese drinks company Kirin Holdings said it would on Friday.\r\n\r\nSuu Kyi spent 15 years under house arrest after leading pro-democracy protests against the long-ruling military junta in 1988.\r\n\r\nAfter sharing power with a civilian government, the army began democratic reforms in 2011. That led to the election of the NLD in a landslide victory four years later. November’s election was meant to solidify a troubled democratic transition.', '0000-00-00 00:00:00', 1),
(3, 1, 'pictures/news/news-3.jpeg', 'Velasco proposes P420-billion Bayanihan 3 law', 'MANILA, Philippines — Speaker Lord Allan Velasco has filed a bill proposing a third installment of the Bayanihan Law, which would provide a P420-billion fund to help the country recover amid the economic crash triggered by the Covid-19 pandemic.\r\n\r\nVelasco, together with Marikina City 2nd District Rep. Stella Luz Quimbo, filed last Thursday House Bill (HB) No. 8628, or the proposed “Bayanihan to Arise As One Act” or Bayanihan 3.\r\n\r\nSome 115 members of major political parties and blocs in the House have expressed their support and signified intent to co-author the said bill, Velasco said in a statement on Sunday. \r\n\r\nHe said the two previous Bayanihan Laws were “not sufficient for the genuine economic recovery of the country.”\r\n\r\nCiting data from the Philippine Statistics Authority, the Marinduque representative noted that the Philippine economy contracted by 9.5 percent in 2020, the worst performance in the nation’s post-war history.\r\n\r\nHe added this is significantly worse than the predicted contraction of 4.5 to 6.6 percent, which was the basis of the Development Budget Coordination Committee for the 2021 National Expenditure Program.\r\n\r\n “Given that actual economic output in 2020 was far below what was assumed for budget purposes, and further losses may still be incurred as the COVID-19 pandemic is expected to prevail well into the current fiscal year, an additional economic stimulus package is needed to help the government meet its recovery targets for the year,” Velasco pointed out.\r\n\r\nThe breakdown of the proposed P420-billion appropriation under Bayanihan 3:\r\n- P52 billion for subsidies to small business for wages and other worker-related expenses\r\n- P100 billion for the capacity-building of businesses in critically impacted sectors\r\n- P108 billion for additional social amelioration to impacted households through programs of the Department of Social Welfare and Development\r\n- P70 billion for the provision of assistance and capacity-building to farmers, livestock producers, and fishermen\r\n- P30 billion for the implementation of unemployment assistance and cash-for-work programs under the Department of Labor and Employment\r\n- P30 billion for internet allowances to primary, secondary and tertiary students and teachers in public and private educational institutions\r\n- P5 billion to the Department of Public Works and Highways for the rehabilitation of typhoon-affected areas, including the repair, reconstruction and/or construction of flood control works, roads, bridges, public buildings and other damaged public works, to be distributed proportionately among affected provinces and cities\r\n- P25 billion to the Department of Health for the procurement of COVID-19 medication and vaccines, and to finance logistics, information awareness campaigns, and other related operational expenses\r\n\r\nVelasco also pointed out that household consumption has significantly declined, contributing as much as 5.7 percent to the total 9.5 percent annual reduction in output in 2020.\r\n\r\n“Government must therefore take the lead to promote business and consumer confidence and social welfare. Increased, well-targeted spending is a vital step to achieving these goals,” he said.  \r\n\r\nIn November last year, Quimbo also filed her own bill for Bayanihan 3, House Bill No. 8031, which will allot another P400 billion to aid in the country’s economic recovery. \r\n\r\nAnother Bayanihan 3 bill, House Bill No. 8059, was also filed last year by Majority Leader Martin Romualdez, Albay Rep. Joey Salceda, and AAMBIS-OWA Rep. Sharon Garin. ', '2021-02-07 19:07:03', 1);
